import React, { useState, useEffect } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "./card.css";
import { Tooltip } from "@material-ui/core";
import { ArrowBackIos, ArrowForwardIos } from "@material-ui/icons";
import axios from "axios";

const Card = () => {
  const [topAlbums, setTopAlbums] = useState([]);
  const [newAlbums, setNewAlbums] = useState([]);
  const [expanded, setExpanded] = useState(false);

  useEffect(() => {
    fetchTopAlbums();
    fetchNewAlbums();
  }, []);

  const fetchNewAlbums = async () => {
    try {
      const response = await axios.get(
        "https://qtify-backend-labs.crio.do/albums/new"
      );
      const simplifiedData = response.data.map((album) => ({
        id: album.id,
        image: album.image,
        follows: album.follows,
        title: album.title,
      }));
      setNewAlbums(simplifiedData);
    } catch (error) {
      console.error("Error fetching new albums:", error);
    }
  };

  const fetchTopAlbums = async () => {
    try {
      const response = await axios.get(
        "https://qtify-backend-labs.crio.do/albums/top"
      );
      const simplifiedData = response.data.map((album) => ({
        id: album.id,
        image: album.image,
        follows: album.follows,
        title: album.title,
      }));
      setTopAlbums(simplifiedData);
    } catch (error) {
      console.error("Error fetching top albums:", error);
    }
  };

  const handleToggleExpand = () => {
    setExpanded(!expanded);
  };

  // Custom NextArrow component
  const NextArrow = (props) => {
    const { className, onClick } = props;
    return (
      <div className={className} onClick={onClick}>
        <ArrowForwardIos />
      </div>
    );
  };

  // Custom PrevArrow component
  const PrevArrow = (props) => {
    const { className, onClick } = props;
    return (
      <div className={className} onClick={onClick}>
        <ArrowBackIos />
      </div>
    );
  };

  return (
    <div className="grid">
      <div className="heading1">
        <div>Top Albums</div>
        {topAlbums.length > 7 && (
          <div onClick={handleToggleExpand} className="headingSub">
            {expanded ? "Collapse" : "Show All"}
          </div>
        )}
      </div>

      <div className="card-container">
        <Slider slidesToShow={7} infinite arrows nextArrow={<NextArrow />} prevArrow={<PrevArrow />}>
          {topAlbums.slice(0, expanded ? topAlbums.length : 7).map((album) => (
            <div key={album.id} className="card">
              <Tooltip title={`${65} Songs`} placement="top">
                <img src={album.image} alt="cardImg" />
              </Tooltip>
              <div>
                <p className="card-follows">{album.follows} Follows</p>
              </div>
              <p className="card-title">{album.title}</p>
            </div>
          ))}
        </Slider>
      </div>

      <br></br>

      <div className="heading1">
        <div>New Albums</div>
        {newAlbums.length > 7 && (
          <div onClick={handleToggleExpand} className="headingSub">
            {expanded ? "Collapse" : "Show All"}
          </div>
        )}
      </div>

      <div className="card-container">
        <Slider slidesToShow={7} infinite arrows nextArrow={<NextArrow />} prevArrow={<PrevArrow />}>
          {newAlbums.slice(0, expanded ? newAlbums.length : 7).map((album) => (
            <div key={album.id} className="card">
              <Tooltip title={`${65} Songs`} placement="top">
                <img src={album.image} alt="cardImg" />
              </Tooltip>
              <div>
                <p className="card-follows">{album.follows} Follows</p>
              </div>
              <p className="card-title">{album.title}</p>
            </div>
          ))}
        </Slider>
      </div>
    </div>
  );
};

export default Card;
